import "./Header.css";

function Header() {
  return (
    <header className="header-container">
      <nav className="header-nav sb">
        <div className="header-title">WillKi's Blog</div>
        <div className="sb">
          <div className="mr-20">aaaaa</div>
          <div>bbbbb</div>
        </div>
      </nav>
    </header>
  );
}

export default Header;
